public class Solution {
    public int LengthOfLongestSubsequence(IList<int> nums, int target) {
        Dictionary<int, int> dp = new Dictionary<int, int>();
        dp[0] = 0;
        int maxLength = -1;
        foreach (int num in nums) {
            Dictionary<int, int> newDp = new Dictionary<int, int>(dp);
            foreach (var entry in dp) {
                int newSum = entry.Key + num;
                if (newSum <= target) {
                    if (!newDp.ContainsKey(newSum)) {
                        newDp[newSum] = entry.Value + 1;
                    } else {
                        newDp[newSum] = Math.Max(newDp[newSum], entry.Value + 1);
                    }
                    if (newSum == target) {
                        maxLength = Math.Max(maxLength, newDp[newSum]);
                    }
                }
            }
            dp = newDp;
        }
        return maxLength;
    }
}
